import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';
import HomePage from "./component/homepage/homepage";
import Login  from "./component/login/login";
import EmployerLogin from './component/login/employerLogin';
import Register from "./component/register/register";
import EmployerRegister from './component/register/employerRegister';
import Profile from "./component/userProfile/userProfile";
import CompProfile from './component/compProfile/compProfile';
import JobCard from "./component/jobCards/JobCard"
import PeopleCard from "./component/peopleCards/PeopleCard"
import NavBar from "./component/navbar/navbar"

class App extends Component {


  render() {

    return (

        <div>
         <NavBar/>

            <Route exact path="/" component={HomePage} />
            <Route path="/login/candidate" 
            render={() =>
              <Login />}



            component={Login} />
            <Route path="/login/employer" component={EmployerLogin} />
            <Route path="/register/candidate" component={Register} />
            <Route path="/register/employer" component={EmployerRegister} />
            <Route path="/userProfile" component={Profile} />
            <Route path="/compProfile" component={CompProfile} /> 
            <Route path ="/JobCard" component= {JobCard} />  
            <Route path ="/PeopleCard" component= {PeopleCard} />     

        </div>

    )
  }
}

export default App;
